export default function Video() {
  return (
    <div className="video-page">
        <div className="left-side-container video-comments-container">
            <div className="video-container">
                {/* <video tabindex="-1" controlslist="nodownload" style={{width: "640px", height: "360px", left: "0px", top: "0px"}} src="blob:https://www.youtube.com/dbb4cd7f-a4f4-4bfe-8e65-2b79dfe0b391"></video> */}
